import React, { Component } from "react";
import "./App.css";
import Week from "./Components/Week";
import { Log, VisualizerProvider } from "react-lifecycle-visualizer";

class App extends Component {
  render() {
    return (
      <div>
        <VisualizerProvider>
          <div style={{ display: "flex" }}>
            <Week />
            <Log />
          </div>
        </VisualizerProvider>
      </div>
    );
  }
}

export default App;
